import React from "react";
import "../assets/ProjectCard.css";
function ProjectCard() {
  return (
    <div className="card">
      <div className="background"></div>
      <div className="card-icon">
        <div className="wrap">
          <i className="fas fa-shield-alt"></i>
        </div>
      </div>
      <div className="card-title">Bu Bir Başlıktır</div>
      <div className="card-content">
        Lorem ipsum dolor sit amet consectetur adipisicing
        elit. Molestiae facere dignissimos deserunt suscipit
        autem mollitia, blanditiis fugiat amet tempora sed
        aliquid non id, veniam repudiandae beatae est
        laboriosam voluptatum. Sunt.
      </div>
    </div>
  );
}

export default ProjectCard;
